class ImageUploader extends BaseControl{
	var $_preserveHttpCookies = true;

	/**
	 * This is method ImageUploader
	 *
	 * @param string $id This is a description
	 * @param int|string $width This is a description
	 * @param int|string $height This is a description
	 */
	function ImageUploader($id = null, $width = null, $height = null) {
		parent::BaseControl($id, $width, $height);

		$this->_javaScriptWriterClassName = 'ImageUploaderWriter';

		$this->_init();
	}


	function render() {

		if ($this->getPreserveHttpCookies()){

			// Add all cookies
			$cookies = '';
			foreach ($_COOKIE as $name => $value) {
				$cookies = $cookies . $name . '=' . $value . ';';
			}

			$functionName = $this->getId()."_PreserveHttpCookies";
			echo "<script type=\"text/javascript\">\n";
			echo "	function ".$functionName."(){\n";
			echo "      if (".$this->getJavaScriptWriterVariableName().".getControlType() == \"Java\")\n";
			echo "			getImageUploader(\"".$this->getId()."\").AddCookie('".$cookies."');\n";
			echo "	}\n";
			echo "</script>\n";

			$this->addClientBeforeUpload($functionName);
		}

		parent::render();
	}


	/**
	 * Get ...
	 *
	 * @return bool
	 */
	function getPreserveHttpCookies() {
		return $this->_preserveHttpCookies;
	}

	/**
	 * Set ...
	 *
	 * @param bool $value
	 */
	function setPreserveHttpCookies($value) {
		$this->_preserveHttpCookies = $value;
	}


