				$sb .= 'UrlHoverFocused=';
				$sb .= $this->_urlHoverFocused;
				$sb .= ';';
			}

			if ($this->_urlPressed != '') {
				$sb .= 'UrlPressed=';
				$sb .= $this->_urlPressed;
				$sb .= ';';
			}

			if ($this->_urlDisabled !=- '') {
				$sb .= 'UrlDisabled=';
				$sb .= $this->_urlDisabled;
				$sb .= ';';
			}

			return $sb;
		}
	}
}

